import React from 'react';
import { NavLink } from 'react-router-dom';
import { BlogPage } from './BlogPage';
import { BlogPost } from './BlogPost';

function Menu(){
    return(
       <nav>
       <BlogPost></BlogPost>
        <ul>
            {routes.map(route => (
                <li>
                    <NavLink
                 
                      to={route.to} >
                        {route.text}
                  </NavLink>
                </li>
            ))}
        </ul>
       </nav>
    )
}

const routes = [];

routes.push({
    to:'/',
    text:'home'
})
routes.push({
    to:'/aprende/articulos',
    text:'blog'
})
routes.push({
    to:'/profile',
    text:'profile'
})

export {Menu}
